import { Component } from '@angular/core';

@Component({
  selector: 'app-create-city-dialog',
  templateUrl: './create-city-dialog.component.html',
  styleUrls: ['./create-city-dialog.component.css']
})
export class CreateCityDialogComponent {

}
<h1 mat-dialog-title>Hi {{newCity.name}}</h1>
<div mat-dialog-content>
  <p>What's your favorite animal?</p>
  <mat-form-field>
    <mat-label>Favorite Animal</mat-label>
    <input matInput [(ngModel)]="data.animal">
  </mat-form-field>
</div>
<div mat-dialog-actions>
  <button mat-button [mat-dialog-close]>No Thanks</button>
  <button mat-button [mat-dialog-close]="newCity.name" cdkFocusInitial>Ok</button>
</div>
